import React from "react";
import SearchBar from "../searchBar/SearchBar.jsx";
import { NavLink } from "react-router-dom";
import styles from "./Nav.module.css";
import Rick1 from "../assets/Img/Rick1.png"



export default function Nav(props) {
    return(
        <div >
            <NavLink to="/instruction">
                <img className={styles.img} src={"/Img/Rick1.png"} alt="rick1" />
            </NavLink>
            <NavLink to="/home">
                <button className={styles.card}>Home</button>
            </NavLink>
            <NavLink to="/about">
                <button className={styles.button3}>About</button>
            </NavLink>
            <SearchBar className={styles.button3} onSearch={props.onSearch} />
        </div>
    )
}
